import React from 'react';
import Meal from './Meal/Meal';
import classes from './Meals.module.css'
// 食物列表的组件
const Meals = (props) => {
    return (
        <div className={classes.Meals}>
            props.mealsData.map(item => <Meal/>)
            <Meal></Meal>
        </div>
    );
}

export default Meals;
